// const [isDeleteAll, setIsDeleteAll] = useState(false);
function AllTodo(props) {
  const [todos, settodos] = useState([]);

  useEffect(() => {
    const getAll = async () => {
      let result = await getAllTodos();
      if (result.length > 0) {
        settodos(result);
      }
    };
    getAll();
    console.log("calls made 33 ", {
      // isGetAll,
      // isDeleted,
      // isInserted,
      // isDeleteAll,
    });
  }, []);
  // isGetAll, isDeleted, isInserted, isDeleteAll
  return (
    <>
      <Navbar bg="dark" expand="sm" variant="dark">
        <Container fluid>
          <Navbar.Brand className="mx-auto">React TodoList</Navbar.Brand>
        </Container>
      </Navbar>
      <Container className="d-flex justify-content-center">
      <Card className="shadow-lg">
        <Card.Body>
          <div>
            <Input placeholder="enter task" variant="light"  animation="glow" xs={4}onChange={(event) => settodo(event.target.value)} ></Input>
            <Button className="" variant="dark" expand="sm" >ADD</Button>
          </div>
          <Table bordered striped responsive>
            <thead>
              <tr>
                <th>ID</th>
                <th>TASK</th>
              </tr>
            </thead>
            <tbody>
              {todos.map((item) => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.task}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    </Container>
    </>
  );
}
export default AllTodo;
